def find_pairs_with_bitwise_and_sum(n, k):
    """"""
    n = n - 1
    pairs = [(i, n - i) for i in range(n // 2 + 1)]
    if k == 0:
        pass
    elif k == n:
        if n == 3:
            return '-1'
        pairs[0] = (n - 1, n)
        pairs[1] = (1, 3)
        pairs[3] = (n - 3, 0)
    elif k <= n // 2:
        pairs[k] = (k, n)
        pairs[0] = (n - k, 0)
    else:
        pairs[n - k] = (k, n)
        pairs[0] = (n - k, 0)
    return '\n'.join([' '.join([str(k) for k in pair]) for pair in pairs])
